.png', '', '2', '1554556830'), ('295', '11', '/static/upload/images/goods/2019/01/14/1547455601314107.jpg', '【品牌】欧单 学媛风 猫咪良品\n\n【吊牌】xueyuanfeng 猫咪良品\n\n【面料质地】网纱绣花钉珠拼接蕾丝 有拉链有内衬（非专业机构鉴定，介意请慎拍）\n\n好的衣服需要好好呵护，务必请冷水手洗(切记别浸泡)拧干就晾晒或则干洗哦~\n\n【商品颜色】实物拍摄 香槟色 颜色很难拍有小色差属正常现象哦\n\n【商品尺寸】XS/S/M/L 小高腰设计 胸那考虑撑开因素哦 微弹的哦\n\n\nXS码尺寸: 衣长82CM.胸围80内合适.腰围63CM.臀围86CM\n\nS码尺寸: 衣长83CM.胸围84内合适.腰围67CM.臀围90CM\n\nM码尺寸: 衣长84CM.胸围88内合适.腰围71CM.臀围94CM\n\nL码尺寸: 衣长85CM.胸围92内合适.腰围75CM.臀围98CM\n\n\n（测量单位是CM，每个人的测量方式不一样，测量的尺寸数据可能会有1~3厘米的差异，请MM们谅解哦）\n\n\nPS：常规码数，可按平时号选择哦。修身版型，如果腰粗可以适当考虑大1号哦~\n\n大圆领，每个人的身材曲线不同，领口不会很平的哦，请谅解~\n\n肩膀那有暗扣哦，可以很好的隐藏了内衣的肩带哦~袖子那略硬哦~', '0', '1564049598'), ('296', '11', '/static/upload/images/goods/2019/01/14/1547455601168384.jpg', '', '1', '1564049598'), ('297', '11', '/static/upload/images/goods/2019/01/14/1547455601898622.jpg', '', '2', '1564049598'), ('298', '11', '/static/upload/images/goods/2019/01/14/1547455601528614.jpg', '', '3', '1564049598'), ('299', '6', '/static/upload/images/goods/2019/01/14/1547453042405182.jpg', 'X5L/SL/V/M (5.0寸)  X5max钢化膜(5.5寸)  X5pro钢化膜(5.2寸)', '0', '1564057484'), ('300', '6', '/static/upload/images/goods/2019/01/14/1547453042614480.jpg', '', '1', '1564057484'), ('301', '6', '/static/upload/images/goods/2019/01/14/1547453042816509.jpg', '', '2', '1564057484'), ('314', '2', '/static/upload/images/goods/2019/01/14/1547451595700972.jpg', '', '0', '1564735109'), ('315', '2', '/static/upload/images/goods/2019/01/14/1547451595528800.jpg', '', '1', '1564735109'), ('316', '2', '/static/upload/images/goods/2019/01/14/1547451595616298.jpg', '', '2', '1564735109'), ('349', '8', '/static/upload/images/goods/2019/01/14/1547454192301566.jpg', '', '0', '1565230383'), ('350', '8', '/static/upload/images/goods/2019/01/14/1547454192448116.jpg', '', '1', '1565230383'), ('351', '8', '/static/upload/images/goods/2019/01/14/1547454192474638.jpg', '', '2', '1565230383'), ('418', '10', '/static/upload/images/goods/2019/01/14/1547455266527628.jpg', '【品牌】欧单 学媛风 猫咪良品\n\n【吊牌】xueyuanfeng 猫咪良品\n\n【面料质地】涤棉拼接蕾丝  后中拉链 有内衬（非专业机构鉴定，介意请慎拍）\n\n好的衣服需要好好呵护，务必请冷水手洗(切记别浸泡)拧干就晾晒或则干洗哦~\n\n【商品颜色】实物拍摄 蓝色 颜色很难拍有小色差属正常现象哦\n\n【商品尺寸】XS/S/M/L 小高腰设计 胸口纽扣是装饰的哦\n\n\nXS码尺寸: 悬挂衣长81CM.胸围80内合适.腰围63CM.臀围86CM\n\nS码尺寸: 悬挂衣长82CM.胸围84内合适.腰围67CM.臀围90CM\n\nM码尺寸: 悬挂衣长83CM.胸围88内合适.腰围71CM.臀围94CM\n\nL码尺寸: 悬挂衣长84CM.胸围92内合适.腰围75CM.臀围98CM\n\n\n（测量单位是CM，每个人的测量方式不一样，测量的尺寸数据可能会有1~3厘米的差异，请MM们谅解哦）\n\n\nPS：常规码数，可按平时号选择哦。修身版型~如果上身偏大可以适当考虑大1号~下摆蕾丝拼接不会很平整的哦~\n\n蕾丝花是手工修剪出来的，每件都有不同和不规则的哦，有小线头和节点是正常现象哦~请亲们谅解哦~', '0', '1566387763'), ('419', '10', '/static/upload/images/goods/2019/01/14/1547455266234658.jpg', '', '1', '1566387763'), ('420', '12', '/static/upload/images/goods/2019/01/14/1547456214155362.jpg', '', '0', '1566387775'), ('421', '12', '/static/upload/images/goods/2019/01/14/1547455907486857.jpg', '', '1', '1566387775'), ('422', '12', '/static/upload/images/goods/2019/01/14/1547455907256518.jpg', '', '2', '1566387775'), ('423', '12', '/static/upload/images/goods/2019/01/14/1547456228913731.jpg', '', '3', '1566387775');
